import React, {Component} from "react"
import styled from 'styled-components'
import Group from './Group.png';




class Home extends Component {
  render(){
  return (


   <div>
     <br/>
    <PictureContainer className ="kimberly-pic">
      <img className ="group" src={Group} class="kimberly-pic"/>
    </PictureContainer>

    <IntroContainer classname ="kimberly-intro">
      <h2 class="kimberly-intro">Hello my name is Kimberly, nice to meet you :)</h2>
      </IntroContainer>






    </div>
  );
  }
}

export default Home;


const PictureContainer = styled.picture`
.kimberly-pic{
  padding-top: 3rem;
  padding-bottom: 3rem;
  display: block;
  margin-left: 5%;
  margin-right: auto;
  width: 50%;

}
`

const IntroContainer = styled.intro`
.kimberly-intro{

}
`
